create table vendas (
	id_venda INT PRIMARY KEY,
	id_funcionario INT,
	id_cliente INT,
	id_livro INT,
	data DATE,
	quantidade INT,
	FOREIGN KEY (id_funcionario) REFERENCES funcionario(id_funcionario),
	FOREIGN KEY (id_cliente) REFERENCES cliente(id_cliente),
	FOREIGN KEY (id_livro) REFERENCES livro(id_livro)
);

